import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Shared/Navbar';
import Footer from './components/Shared/Footer';
import HomePage from './components/Home/HomePage';
import DevLogin from './components/Auth/DeveloperLogin'; // Import du composant DeveloperLogin

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/login/developer" element={<DeveloperLogin />} /> {/* Ajout de la route pour DeveloperLogin */}
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
